import { styled } from "@mui/material";



export const HeaderContainer = styled(Box)(()=> ({
    display:"flex",
    justifyContent:"space-between",
    alignItems:"center",
    padding:"10px",

}))

export const IconContainer = styled(Box)(()=> ({
    background: Colors.white,
    borderRadius:"50%",
    height:"50px",
    width: "50px",
}))
